package javacore;

public class ForLoop {

	@SuppressWarnings("unused")
	public static void main(String[] args) {
		// TODO Auto-generated method stub

		if (5 > 2) {
			System.out.println("hello");
		} else {
			System.out.println("hi");
		}
		
		
		for(int i=0;i<10;i++)
		{
			System.out.println(i);
		}

	}

}
